#include <M5Core2.h>                 // M5Stack M5Stack Core2
#define  LGFX_AUTODETECT
#include <LovyanGFX.hpp>
#include <random>

static LGFX lcd;
static LGFX_Sprite sprite(&lcd);
extern const uint16_t imgWidth;
extern const uint16_t imgHeight;
extern const unsigned short img[];
extern const unsigned char previewR[120264];

std::random_device seed_gen;
std::mt19937 engine(seed_gen());
std::uniform_real_distribution<> dist2(0.3, 1.8);

void setup() {
  Serial.begin(115200);
  M5.begin(true, true, true, true, mbus_mode_t::kMBusModeOutput, true);  // Init M5Core2.
  lcd.init();
  lcd.clear(TFT_YELLOW);
  sprite.setBuffer((void*)img, imgWidth, imgHeight, 16);
  M5.Spk.begin();
  M5.Spk.PlaySound(previewR, sizeof(previewR));  // Play the DingDong sound.
}

void loop() {
  int x = rand() % lcd.width();
  int y = rand() % lcd.height();
  int angle = random(360);

  sprite.setPivot(x, y);
  sprite.pushRotated(angle, TFT_WHITE);
  static std::uint32_t count;
  if (++count == 100) {
    count = 0;
    delay(2000);
    M5.Spk.PlaySound(previewR, sizeof(previewR));  // Play the DingDong sound.
    lcd.clear();
  }

  float zoom = dist2(engine);
  //  Serial.printf("X = %3d Y = %3d angle = %3d Zoom = %5.3f \n", x, y, angle, zoom);
  sprite.pushRotateZoom(&lcd, lcd.width() >> 1, lcd.height() >> 1, count, zoom, zoom, TFT_WHITE);
  delay(50);
}

